// src/components/PersonalCard.jsx
import React from "react";
import { ListChecks, BookOpen, Target, Activity } from "lucide-react";

function PersonalCard() {
  const items = [
    { name: "To-Do List", icon: <ListChecks className="w-5 h-5 text-blue-500" /> },
    { name: "Journal", icon: <BookOpen className="w-5 h-5 text-green-500" /> },
    { name: "Goals", icon: <Target className="w-5 h-5 text-red-500" /> },
    { name: "Habits", icon: <Activity className="w-5 h-5 text-purple-500" /> },
  ];

  return (
    <div className="bg-white shadow-md rounded-2xl p-6 border border-gray-200">
      <h2 className="text-xl font-semibold mb-4 tracking-wide">Personal</h2>
      <ul className="space-y-3">
        {items.map((item, index) => (
          <li key={index} className="flex items-center gap-3 text-gray-700">
            {item.icon}
            <span className="text-sm font-medium">{item.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PersonalCard;
